import React from 'react';
import './cards.css';
import '.././App.css';
import Carditem from './Carditem';
import { Button } from 'react-bootstrap';
import { Card} from 'react-bootstrap';
function Cards(){
    return(
        <div className='cards'>
           
                <div className='cards__container'>
                <h1>Check out these amazing destinations</h1>
                    <div className='cards__wrapper'>
                        <ul className='cards__items'>
                            
                            <Carditem 
                           src={require('./images/1.jpg').default}
                            text='Explore the hidden waterfall deep inside the Amazon jungle'
                            label='Adventure'
                            path='/services'/>
                             <Carditem 
                           src={require('./images/china.jpg').default}
                            text='Explore the hidden waterfall deep inside the Amazon jungle'
                            label='Adventure'
                            path='/services'/>
                            <Carditem
                            src={require('./images/img-3.jpg').default}
                            text='Explore the hidden waterfall deep inside the Amazon jungle'
                            label='Adventure'
                            path='/services'/>
                            <Carditem
                            src={require('./images/greece.jpg').default}
                            text='Explore the hidden waterfall deep inside the Amazon jungle'
                            label='Adventure'
                            path='/services'/>
                        </ul>
                        <ul className='cards__items'>
                            <Carditem
                            src={require('./images/paris.jpg').default}
                            text='Explore the hidden waterfall deep inside the Amazon jungle'
                            label='Adventure'
                            path='/services'/>
                            <Carditem
                            src={require('./images/img-8.jpg').default}
                            text='Explore the hidden waterfall deep inside the Amazon jungle'
                            label='Adventure'
                            path='/services'/>
                             <Carditem
                            src={require('./images/city2.jpg').default}
                            text='Explore the hidden waterfall deep inside the Amazon jungle'
                            label='Adventure'
                            path='/services'/>
                        </ul>
                    </div>

                    
                </div>

            
        </div>
    );

}
export default Cards;
